polymer = """

""".strip()

from copy import deepcopy
import re

regex = re.compile("aA|bB|cC|dD|eE|fF|gG|hH|iI|jJ|kK|lL|mM|nN|oO|pP|qQ|rR|sS|tT|uU|vV|wW|xX|yY|zZ|Aa|Bb|Cc|Dd|Ee|Ff|Gg|Hh|Ii|Jj|Kk|Ll|Mm|Nn|Oo|Pp|Qq|Rr|Ss|Tt|Uu|Vv|Ww|Xx|Yy|Zz")

for letter in "abcdefghijklmnopqrstuvwxyz":
    data = deepcopy(polymer)
    data = data.replace(letter, "")
    data = data.replace(letter.upper(), "")
    prev_data = None
    while prev_data != data:
        prev_data = deepcopy(data)
        data = regex.sub('', data)
    print(letter, len(data))
